import React from "react"; //import React library
import { TableHeader } from "./TableHeader";
import { SenatorRow } from "./SenatorRow";

const EXAMPLE_SENATORS = [
  {
    id: "C000127",
    name: "Maria Cantwell",
    state: "WA",
    party: "Democrat",
    phone: "202-224-3441",
    twitter: "SenatorCantwell",
  },
  {
    id: "M001111",
    name: "Patty Murray",
    state: "WA",
    party: "Democrat",
    phone: "202-224-2621",
    twitter: "PattyMurray",
  },
];

/* Your code goes here */

export function SenatorTable({ senatorsList }) {
  let columnNames = ["Name", "State", "Party", "Phone", "Twitter"];
  let tableRows = senatorsList.map((senator) => {
    return <SenatorRow key={senator.id} senator={senator} />;
  });
  return (
    <table className="table table-bordered">
      <TableHeader columnNames={columnNames} />
      <tbody>{tableRows}</tbody>
    </table>
  );
}
